import React from 'react'
import Meal from './Meal/Meal'
import classes from './Meals.module.css'


/** FOOD LIST */
export default function Meals(props) {
  return (

    /*use CSS let roller to Meals not to body*/ 
    <div className={classes.Meals}>
        
        <Meal/>
        <Meal/>
    </div>
  )
}
